import React,{useState} from "react";
import './Header.css';
import Jaipur from "./Jaipur";

const Header = () => {
    const [title, setTitle] = useState('');
    return (
        <div>
            <div className="container">
                <input type="text"
                onMouseOut="if (event.keyCode == 13) {e => setTitle(e.target.value)}"
                className="searchbar"></input>
                <div className="button-images">
                    <button type="button">Jaipur</button>
                    <button type="button">Mumbai</button>
                    <button type="button">Goa</button>
                </div>
            </div>
            <Jaipur/>
            {console.log(title)}
        </div>
    );
};

export default Header;
